const Producto = (props) => {
  const product = props.product;

  return <div>
    <h1>Producto: {product.name}</h1>
    <image href={product.image}></image>
    <p>Precio: <strong>{product.price}</strong></p>
    <p>product.description</p>
  </div>;
};

export default Producto;
